CREATE TABLE jobs(
    job_id serial PRIMARY KEY,
    job_name VARCHAR(100) NOT NULL
);
CREATE TABLE workers(
    worker_id serial PRIMARY KEY,
    worker_name VARCHAR(100) NOT NULL,
    workers_job INT NOT NULL REFERENCES jobs(job_id) ON DELETE CASCADE
);


SELECT * FROM jobs;
SELECT * FROM workers;

SELECT worker_name, job_name FROM jobs INNER JOIN workers ON job_id = workers_job;
SELECT * FROM jobs INNER JOIN workers ON job_id = workers_job;


